import React from "react";
import "./services.css";
import { Container, Col, Row } from "reactstrap";
import offer2 from "../assets/images/offer2.webp";
import offer3 from "../assets/images/offer3.avif";
import offer1 from "../assets/images/offer1.jpeg"


const ServicesCard = () => {

  return (
    <section>
      <Container>
        <Row>
          <Col>
            <div className="service_item">
              <div className="service_img">
                <img src={imgurl} alt={title} />
              </div>
              <div className="service_content">
                <h5 className="service_title">{title}</h5>
                <p className="service_desc">{desc}</p>
              </div>
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default ServicesCard;
